import React from 'react';
import { Avatar, Input, Button } from '@momentum-ui/react';

class Landing extends React.Component {

    render() {
        return (
            <div className="grid">
                <div className="row large-offset-1">
                    <div className="columns medium-4">
                        <h1>Classroom Set Up</h1>
                    </div>
                    <div className="medium-2 columns">
                        <Avatar title="Barbara" src="http://react.collab-ui.com/barbara.png"/>
                    </div>
                </div>
                <div className="row large-offset-1">
                    <div className="columns medium-8">
                    <t>For each class, we'll walk you through the set-up process. Youll need names and email addresses of students for the set-up process.</t>
                    </div>
                </div>
            </div>
        );
    }
}
export default Landing;
